import {useState, useEffect} from 'react'

export default function KarangosForm(){

    const [karango, setKarengo] = useState({
        id: null,
        marca: '',
        modelo: '',
        cor: '',
        ano_fabricacao: (new Date()).getFullYear(),
        importado: false,
        placa: ''
    })

    return(
        <h1>Cadastrar Novo Karango</h1>
    )
}
